"use strict";
// Explication : Vérifie si une propriété existe dans un objet ou un index dans un tableau.
// En TypeScript, l'opérateur in permet de vérifier si une propriété existe dans un objet ou si un index existe dans un tableau.
const x = ["hp", "dell", "macbook", "asus"];
console.log(0 in x);
console.log(1 in x);
console.log(5 in x);
